import React from 'react'

export default function AffichereFil(props) {
  return (
    <div>
        
        <h2>Filiere :</h2>
        <div>Code Filliere :{props.Fillier.codefil} -nom de Fillier : {props.Fillier.nomfil}</div>
        <hr/>
        <h3>Liste</h3>
    </div>
  )
}
